// Set a variable to track the tooltip timer
let tooltipTimer;

// Event handler functions
function showTooltip(event, tooltipId='') {
  // Clear the previous tooltip timer if it exists
  clearTimeout(tooltipTimer);

  const tooltip = document.getElementById(`tooltip-${tooltipId}`)

  // Start a new timer to show the tooltip after a delay (e.g., 300 milliseconds)
  tooltipTimer = setTimeout(() => {
    tooltip.style.display = 'block';
    const tooltipDetail = event.target.getAttribute('data-detail')
    const tootipCount = event.target.getAttribute('data-count')
    tooltip.innerHTML = `<div>`
    tooltip.innerHTML += `<div>${event.target.getAttribute('title')}</div>`
    if (tooltipDetail) {
        tooltip.innerHTML += `<div><small>${tooltipDetail}</small></div>`
    }
    if (tootipCount) {
        tooltip.innerHTML += `<small>${tootipCount}</small>`
    }
    tooltip.innerHTML += `</div>`
  }, 300);
}

function moveTooltip(event, tooltipId='') {
    const tooltip = document.getElementById(`tooltip-${tooltipId}`)
    const container = tooltip.parentElement
    const containerRect = container.getBoundingClientRect();
    const xErrror = 30
    const yError = 60
    let x = event.pageX;
    let y = event.pageY;
    if (tooltipId === 'sm') {
        x = x - containerRect.left;
        y = y - containerRect.top;
    }
    tooltip.style.left = `${x}px`;
    tooltip.style.top =  `${y}px`;
}

function hideTooltip(event, tooltipId='') {
    // Clear the tooltip timer if it exists
    const tooltip = document.getElementById(`tooltip-${tooltipId}`)
    clearTimeout(tooltipTimer);
    tooltip.style.display = 'none';
}

function setPathLabels(mapId='') {
    const screenWidth = window.innerWidth;
    const screenHeight = window.innerHeight;
    const svg = document.getElementById(`map-svg-${mapId}`);
    const g = document.getElementById(`map-g-layer-${mapId}`)
    const paths = svg.querySelectorAll(`[map-path=map-path-${mapId}]`);
    const svgRect = svg.getBoundingClientRect();

    let errorX = 350
    let errorY = 110
    if (screenWidth > 800 && screenWidth < 1000) {
        errorX = 0
        errorY = 160
    }
    if (screenWidth <= 800) {
        return
    }
    
    const tts = document.getElementsByName(`map-label-${mapId}`)
    if (tts) {
        Array.from(tts).forEach(function(tt) {
            document.body.removeChild(tt)
        })
    }

    const svgOffsetX = svgRect.left - errorX;
    const svgOffsetY = svgRect.top - errorY;
    const multiPaths = {}
    Array.from(paths)
        .forEach(function(path) {
            const title = path.getAttribute('title');
            const base = title.replace(' ', '_').toLowerCase()
            const id = `map-label-${base}-${mapId}`
            const tooltip = document.createElement('div');
            tooltip.setAttribute('id', id)
            tooltip.setAttribute('name', `map-label-${mapId}`)
            tooltip.classList.add('map-label-tooltip');
            tooltip.textContent = title
            document.body.appendChild(tooltip);
            const pathRect = path.getBoundingClientRect();
            const pathCenterX = pathRect.left + pathRect.width / 2 - svgOffsetX;
            const pathCenterY = pathRect.top + pathRect.height / 2 - svgOffsetY;

            const percentX = 100 * pathCenterX / screenWidth;
            const percentY = 100 * pathCenterY / screenHeight;

            tooltip.style.left = `${percentX}%`;
            tooltip.style.top = `${percentY}%`;

            const name = path.getAttribute('name')
            const pathsInRegion = document.getElementsByName(name)
            if (pathsInRegion) {
                if (pathsInRegion.length > 0) {
                    const pathArea = pathRect.height * pathRect.width
                    if (!multiPaths[name]) {
                        multiPaths[name] = { area: 0, }
                    }
                    if (pathArea > multiPaths[name].area) {
                        multiPaths[name] = {
                            area: pathArea,
                            path: path.id,
                        }
                    }
                }
            }
        })
    if (multiPaths) {
        Object.keys(multiPaths).forEach(function(name) {
            thisPath = document.getElementById(multiPaths['path'])
            allSame = document.getElementsByName(name)
            thisPath = multiPaths[name]['path']
            for (same of allSame) {
                same.hidden = true
                if (same.id === thisPath) {
                    // same.hidden = false
                    // console.log(same.getAttribute('title'), same.getAttribute('name'), same.id, thisPath)
                }
            }
            // if (thisPath) {
            //     console.log(thisPath)
            //     thisPath.hidden = false
            // }
        })
    }
}


function setPathEvents(mapId='') {
    // Get the SVG element and the path element
    const paths = document.querySelectorAll(`[map-path=map-path-${mapId}]`);
    // const paths = document.getElementsByTagName('path');

    function handleMouseOver(event) { showTooltip(event, mapId); }
    function handleMouseMove(event) { moveTooltip(event, mapId); }
    function handleMouseOut(event) { hideTooltip(event, mapId); }
    function handleClick(event) {
        const href = event.target.getAttribute('data-href')
        if (href) { window.location.href = href }
    }

    Array.from(paths)
        .forEach(function(path) {
            path.classList.add('pointer')
            path.addEventListener('mouseover', handleMouseOver);
            path.addEventListener('mousemove', handleMouseMove);
            path.addEventListener('mouseout', handleMouseOut);
            path.addEventListener('click', handleClick);
        })
}


function buildMap(mapId='') {
    const defs = document.getElementById(`map-defs-layer-${mapId}`)
    const g = document.getElementById(`map-g-layer-${mapId}`)

    const mapData = fetchMapData()
    const chartData = {} // fetchChartData()
    let pathNumber = 0

    mapData.forEach(function (map) {
        const baseName = map.title.toLowerCase().replace(' ', '_')
        const pathId = `${baseName}_area-${mapId}`
        const lineId = `${baseName}_line-${mapId}`

        // create map line
        let line = document.createElement('linearGradient')
        line.setAttribute('id', lineId)
        line.setAttribute('name', `map-line-${lineId}`)
        line.setAttribute('inkscape:collect', 'always')
        line.setAttribute('xlink:href', `#map-stroke-color-linear-gradient-${mapId}`)
        line.setAttribute('x1', map.line.x1)
        line.setAttribute('y1', map.line.y1)
        line.setAttribute('x2', map.line.x2)
        line.setAttribute('y2', map.line.y2)
        line.setAttribute('gradientUnits', 'userSpaceOnUse')
        line.setAttribute('gradientTransform', 'translate(-15.349574,-28.447599)')
        // add to map
        defs.innerHTML += line.outerHTML

        // create map area
        let area = document.createElement('path')
        const color = chartData[baseName]?.color || '#F2F2F2' // '#F7D3EC'
        let votes = ''
        let party = ''
        if (chartData[baseName]?.party) { party = chartData[baseName]?.party }
        if (chartData[baseName]?.votes) { votes = `${chartData[baseName]?.votes} votes` }
        const mapStyle = `fill:${color};stroke:url(#${lineId});stroke-width:.51`
        if (party) {
            area.setAttribute('data-detail', party)
        }
        if (votes) {
            area.setAttribute('data-count', votes)
        }
        area.setAttribute('id', `${pathId}-${pathNumber}`)
        // picker for all paths representing the same region
        area.setAttribute('name', `map-area-${pathId}`)
        // picker for all paths in the same map
        area.setAttribute('map-path', `map-path-${mapId}`)
        area.setAttribute('title', map.title)
        area.setAttribute('inkscape:label', map.title)
        area.setAttribute('d', map.d)
        area.setAttribute('style', mapStyle)
        pathNumber++;
        // add to map
        g.innerHTML += area.outerHTML
    })

    setPathEvents(mapId)
}

function buildMapWithChart(mapId='', chartData=[]) {
    const mapData = fetchMapData()
    const defs = document.getElementById(`map-defs-layer-${mapId}`)
    const g = document.getElementById(`map-g-layer-${mapId}`)
    const key = document.getElementById(`map-key-layer-${mapId}`)

    // g.innerHTML= ''
    // defs.innerHTML= ''
    key.innerHTML= ''

    // ensure that the map exists

    function setPathAttributes(path, data={}) {
        if (path) {
            // path.setAttribute('id', `${mapId}`)
            // path.setAttribute('name', `${mapId}`)
            // path.setAttribute('title', '')
            path.setAttribute('data-detail', '')
            if (data?.party__code && data?.total_votes) {
                path.setAttribute(
                    'data-detail',
                    `${data?.party__code}: ${data?.total_votes} votes`
                )
            }
            path.setAttribute('data-count', '')
            // if (data?.region__title) {
            //     path.setAttribute('title', data?.region__title)
            // }
            path.style.fill = '#F2F2F2'
            if (data?.color) {
                path.style.fill = data?.color
            }
            if (data?.report_url) {
                path.setAttribute('data-href', data?.report_url)
            }
        }
    }

    function addMapKey(mapId='', title='', color='') {
        const key = document.getElementById(`map-key-layer-${mapId}`)
        key.innerHTML += `<div class="col-1">
                            <i class="fa fa-circle f10" style="color:${color};"></i>
                          </div>
                          <div class="col-10">
                            ${title}
                          </div>`
    }

    // clear all data items on the map
    const container = document.getElementById(`map-g-layer-${mapId}`);
    const domPaths = container.querySelectorAll('path');
    // Iterate over the div nodes
    domPaths.forEach(function(domPath) {
        setPathAttributes(domPath, {})
    });

    // plot new areas
    let parties_visited = []
    Array.from(chartData).forEach(function (data) {
        const baseName = data?.region__title.toLowerCase().replace(' ', '_')
        const areaName = `map-area-${baseName}_area-${mapId}`
        // const lineName = `map-line-${baseName}_line-${mapId}`
        const paths = document.getElementsByName(areaName)
        Array.from(paths).forEach(function(path) {
            if (!parties_visited.includes(data?.party__code) &&  data?.party__code && data?.color) {
                addMapKey(mapId, data?.party__code, data?.color)
                parties_visited.push(data?.party__code)
            }
            setPathAttributes(path, data)
        })
    })
    
}


